import React from "react";
import styled from "styled-components";

const AboutWrapper = styled.div`
  max-width: 800px;
  margin: 100px auto 0;
  padding: 2rem;
  text-align: center;
  color: white;
`;

const Title = styled.h2`
  font-size: 2.5rem;
  margin-bottom: 1rem;
`;

const Text = styled.p`
  font-size: 1.1rem;
  line-height: 1.6;
  color: #ccc;
`;

const About = () => {
  return (
    <AboutWrapper>
      <Title>About Us</Title>
      <Text>
        We are a team passionate about creating immersive digital experiences.
        Our perfume gallery showcases the fusion of visual design and scent storytelling.
      </Text>
    </AboutWrapper>
  );
};

export default About;
